css:
.contact-card-fullcontact {
  padding-bottom: 0;
  order: 1;
  flex-shrink: 0;
  color: #231f20;
  -webkit-user-select: text;
}
.contact-card-fullcontact img.content-mask {
  background-color: #231f20;
}
.contact-card-fullcontact h1.name {
  font-size: 20px;
  font-weight: 400;
  margin: 0;
  padding: 0.6em 0 0.4em 0;
  text-overflow: ellipsis;
  overflow: hidden;
}
.contact-card-fullcontact .profile-photo {
  max-width: 42px;
  max-height: 42px;
  display: block;
  float: right;
  margin-left: 15px;
}
.contact-card-fullcontact .header:before,
.contact-card-fullcontact .header:after {
  content: " ";
  display: table;
}
.contact-card-fullcontact .header:after {
  clear: both;
}
.contact-card-fullcontact .subheader {
  color: rgba(35, 31, 32, 0.8);
  padding: 0 0 15px 0;
  font-size: 12px;
}
.contact-card-fullcontact .email {
  word-break: break-all;
}
.social-profiles {
  border-top: 1px solid #dddddd;
  padding-top: 7px;
}
.social-profile {
  margin-top: 0.5em;
}
.social-profile .social-icon {
  margin-top: 6px;
  float: left;
}
.social-profile .social-link {
  padding-left: 30px;
  font-size: 12px;
}
.social-profile .social-link a {
  text-decoration: none;
}
.sidebar-extra-info {
  font-size: 12px;
  font-weight: 500;
  color: rgba(35, 31, 32, 0.8);
}
.sidebar-no-info {
  font-size: 12px;
  color: rgba(35, 31, 32, 0.3);
}
